import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [getData, setgetData] = useState([]);

  let fetchData = async () => {
    try {
      let res = await axios.get(
        "https://api.nasa.gov/planetary/apod?api_key=0VQHai1DdOa13R31A5H4kdGZbiVnfRrA8bIVvi3l"
      );
      setgetData(res.data);
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);
  console.log(getData);
  return (
    <div>
      {getData.map((newData) => (
        <div>
          <h1>{newData.caption}</h1>
          <h1>{newData.image}</h1>

          <image src={newData.image} width="50" height="50" />
        </div>
      ))}
    </div>
  );
}

export default App;
